import './App.css';
import Footer from './Footer';
import SideBar from './Sidebar';
import {BrowserRouter, Route, Routes} from "react-router-dom"

function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<SideBar/>}/>
      <Route path='/foot' element={<Footer/>}/>
      <Route path='/na'></Route>

    </Routes>
    </BrowserRouter>
  </>
  );
}

export default App;
